def test_load_conference_talk() -> None:
    """It returns a valid Document for a conference talk."""
    result = load_conf.load_conference_talk(
        "https://www.churchofjesuschrist.org/study/general-conference/2023/10/11bednar?lang=eng",
        html,
    )
    assert len(result.page_content) > 0
    assert result.metadata["title"] == "In the Path of Their Duty"
    assert result.metadata["author"] == "By Elder David A. Bednar"
    assert result.metadata["author_role"] == "Of the Quorum of the Twelve Apostles"
